import NavBar from "./components/NavBar"

const Header = () => {
  return (
    <header className="header">
      <Link to="/">
        <h1 className="header__titlo">E-Commerce</h1>
      </Link>
      <Nav nombre="Alejandro" apellido="Duque" footer={false}/>
    </header>
  )
}

export default Header
